function i = LED(type,size)
if nargin < 1
  type = '';
end
switch lower(type)
  case {'g','green'}
    d = '';
  case {'r','red'}
    d = '';
  case {'y','yellow'}
    d = '';
  otherwise
    d = '';
end
i = javaObjectEDT('javax.swing.ImageIcon',org.apache.commons.codec.binary.Base64.decodeBase64(uint8(d)));
if nargin > 1
  i = javaObjectEDT('javax.swing.ImageIcon',i.getImage().getScaledInstance(size(1),size(2),java.awt.Image.SCALE_SMOOTH));
end
